import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../App.css";
import Footer from "../Components/Footer";
import { Link } from "react-router-dom";

function Register() {
  return (
    <>
      <div class="main">
        <div class="content">
          <p class="fixName">Rejestracja</p>
          <div class="fixRegister">
            <label>Login</label>
            <input class="fixInputRegister"></input>
            <label>Nazwa</label>
            <input class="fixInputRegister"></input>
            <label>Hasło</label>
            <input class="fixInputRegister"></input>
          </div>
          <div class="fixButtonRegister">
            <button className="btn btn-warning">Zaloguj</button>
            <button className="btn btn-warning">Załóż konto</button>
          </div>
          <div class="backButton">
            <Link to="/" className="btn btn-secondary">
              Powrót
            </Link>
          </div>
        </div>
      </div>
    </>
  );
}

export default Register;
